import React from "react";
import styled from "styled-components";

export const Cell = (props) => {
  return (
    <StyledDiv>
      {props.value != -1 ? (
        <div>{props.value}</div>
      ) : (
        <Notes>
          <p>{props.note1}</p>
          <p>{props.note2}</p>
          <p>{props.note3}</p>
          <p>{props.note4}</p>
          <p>{props.note5}</p>
          <p>{props.note6}</p>
          <p>{props.note7}</p>
          <p>{props.note8}</p>
          <p>{props.note9}</p>
        </Notes>
      )}
    </StyledDiv>
  );
};

Cell.defaultProps = {
  value: -1,
  note1: 0,
  note2: 0,
  note3: 0,
  note4: 0,
  note5: 0,
  note6: 0,
  note7: 0,
  note8: 0,
  note9: 0,
};

const StyledDiv = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  height: 100%;
  width: 100%;
  overflow: hidden;
  border: 1px solid lightgray;
  color: #61dbfb;
`;

const Notes = styled.div`
  display: grid;
  grid-template-rows: repeat(3, 1fr);
  grid-template-columns: repeat(3, 1fr);
  max-width: 100%;
`;
